import "./styles.css";

import React from 'react';

// 头部组件
function Header() {
  return (
    <header>
      <h1>CurrenSee</h1>
    </header>
  );
}

// 导航组件
function Navigation() {
  return (
    <nav>
      <a href="#">Dashboard</a>
      <a href="#">Converter</a>
      <a href="#">Chart</a>
      <a href="#">About Me</a>
    </nav>
  );
}

// 转换器组件
function Converter() {
  return (
    <div className="converter">
      <h2>Converter</h2>
      {/* 转换器相关的内容 */}
    </div>
  );
}

// 图表组件
function Chart() {
  return (
    <div className="chart">
      <h2>Chart</h2>
      {/* 图表相关的内容 */}
    </div>
  );
}

// 关于我组件
function AboutMe() {
  return (
    <div className="about-me">
      <h2>About Me</h2>
      {/* 关于我的内容 */}
    </div>
  );
}

// 汇率监视列表组件
function ExchangeRateWatchlist() {
  return (
    <div className="exchange-rate-watchlist">
      <h2>Exchange Rate Watchlist</h2>
      {/* 汇率监视列表相关的内容 */}
    </div>
  );
}

// App 组件
export default function App() {
  return (
    <div>
      <Header />
      <Navigation />
      <main>
        <Converter />
        <Chart />
        <AboutMe />
        <ExchangeRateWatchlist />
      </main>
    </div>
  );
}
